      <text id="65" justification="0" size="4" underlined="false">
        <text>LoginGUI crea una scheda dove faccio il login e 
successivamente setto la mappa che voglio usare
dopo di che chiama SagradaGUI che crea
l interfaccia del gioco vero e proprio..

A questo punto vengono pescati gli obiettivi
e i tools, creata la griglia di gioco con 
la mappa usata, impostato il turno a 1, 
aggiornato le info giocatori con nome,
 griglia corrente (di defoult vuota) e 
mappa usata. vengono infine date le gemme al giocatore 
in base alla mappa scelta.

Qui comincia il gioco</text>
